@-moz-document domain("roblox.com")
{
/* Glitter Roblox Logo */
  .icon-logo,
.light-theme .icon-logo,
.dark-theme .icon-logo
  {
    background-image: url("https://i.ibb.co/tDM3zhz/Whole-Roblox-y2k.png");
  }

  .icon-logo-r,
.light-theme .icon-logo-r,
.dark-theme .icon-logo-r,
.icon-logo-r-95,
.light-theme .icon-logo-r-95,
.dark-theme .icon-logo-r-95
  {
    background-image: url("https://i.ibb.co/pJ90tMt/Roblox-y2k.png");
  }
}
